import { react, useState } from 'react';
import '../styles/Form.css';


const Form = () => {

    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPass] = useState('');

    const PersistForm = () => {
        console.log(`UserName: ${name},  Email: ${email},  Password: ${password}`);
    }

    return (
        <form>
            <label className='title'>
                <h3>Basic Form Functionality</h3>
                </label> <br />
            <label id='nameLabel' for='nameInput' >Name</label>
            <input id='nameInput' type='text' required placeholder='Enter Name...' value={name} onChange={(nam) => setName(nam.target.value)}></input>
            <label id='emailLabel' for='emailInput'></label>
            <input id='emailInput' type='email' required placeholder='Enter Email...' value={email} onchange={(ema) => setEmail(ema.target.value)}></input>
            <label id='passwordLabel' for='passwordInput'></label>
            <input id='passwordInput' type='password' required value={password} onchange={(pas) => setPass(pas.target.value)}></input>
        </form>
        );
};

export default Form;
